create database objetivo;

create schema elo;

CREATE TABLE elo.pessoa (
	id int NOT NULL,
	nome varchar(150) NOT NULL,
	datanascimento date NOT NULL,
	cnpj_cpf varchar(20) NOT NULL,
	telefone varchar(11) NOT NULL,
	idade varchar(20) NOT NULL
);

create table elo.endereco  (
	id int NOT NULL,
	pessoa_id int NOT NULL,
	cep numeric(10) NOT NULL,
	logradouro varchar(150) NOT NULL,
	numero varchar(10) NOT NULL,
	cidade varchar(100) NOT NULL,
	uf varchar(2) NOT NULL
);

alter table elo.pessoa add CONSTRAINT pkpessoa PRIMARY KEY (id);
alter table elo.pessoa add CONSTRAINT u_cnpj_cpf unique(cnpj_cpf);
alter table elo.endereco add CONSTRAINT pkendereco PRIMARY KEY (id);
alter table elo.endereco add CONSTRAINT fkpessoa_endereco foreign key (pessoa_id) references elo.pessoa(id);


